import Link from 'next/link'
import Navbar from 'react-bootstrap/Navbar'

export default function GlobalHeader(props) {
    return (
        <Navbar bg="light">
            <Link href="/">
                <a>
                    <Navbar.Brand>React-Bootstrap</Navbar.Brand>
                </a>
            </Link>
        </Navbar>
    )
}
